import './navba.css';

function Navbar(){
    return(
        <div>
            <ul className="nav-lists">
                <li>Home</li>
                <li>Category</li>
                <li>About</li>
                <li>Contact</li>
            </ul>
        </div>
    );
}
export default Navbar;
